def icbrt(n: int) -> int:
    if n == 0: return 0
    x = 1 << ((n.bit_length() + 2)//3)
    while True:
        y = (2*x + n//(x*x)) // 3
        if y >= x: break
        x = y
    while (x+1)**3 <= n: x += 1
    while x**3 > n: x -= 1
    return x

